import { Fragment } from "react";
import mealsImage from "../../assets/meals.jpg";

const Header = (props) => {
  return (
    <Fragment>
      <header>
        <hi>ReactMeal</hi>
        <button>Cart</button>
      </header>
      <div>
        <img src={mealsImage} alt="A table full of delicious food!" />
      </div>
    </Fragment>
  );
};

export default Header;
